const Menu = () => {
    return(

        <>
        <div style={{ backgroundColor: 'yellow'}}>
        <NavLink exact ctiveClassName="active_class" to='/'> Home </NavLink>&nbsp;
        <NavLink exact activeClassName="active_class" to='/secondpage'> Customers </NavLink>
        </div>

        </>
       
    );
}


export default Menu;
